import {Component, Input} from "@angular/core";

@Component({
  selector: 'button-element',
  template: '<button [type]="buttonType">{{ text }}</button>'
})

export class ButtonComponent{
  @Input() buttonType: string | undefined;
  @Input() text: string | undefined;
}
